      SELECT DISTINCT - 40 FROM tab0 (FORMAT parquet) AS cor0 WHERE NULL IN ( + col1 / - - col1 * + col2 + - - col1 * + col1 * - CAST ( NULL AS INTEGER ) );
  - name: tab0

outputs:
  - name: q696.out
    data: |
